// React imports
import React from 'react';
import { useNavigate } from 'react-router-dom';

// Material UI components and icons
import { Box, Typography, IconButton, useTheme } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';

const RealEstateBot = () => {
    const navigate = useNavigate();
    const theme = useTheme();

    const handleBack = () => {
        navigate(-1); // Navigate back to the previous page
    };

    const style = {
        container: {
            padding: theme.spacing(3),
            color: theme.palette.common.white,
            backgroundColor: theme.palette.background.default,
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            maxWidth: '600px',
            marginLeft: 'auto',
            marginRight: 'auto',
            [theme.breakpoints.down('md')]: {
                maxWidth: '100%',
                padding: theme.spacing(1),
            },
        },
        header: {
            marginBottom: theme.spacing(2),
        },
        paragraph: {
            marginBottom: theme.spacing(1),
            textAlign: 'left',
        },
        featureBox: {
            marginTop: theme.spacing(4),
            textAlign: 'left',
        },
        featureHeading: {
            marginBottom: theme.spacing(1),
        },
    };

    return (
        <Box sx={style.container}>
            <IconButton onClick={handleBack} sx={{ position: 'absolute', top: 20, left: 20, zIndex: 1 }}>
                <ArrowBackIcon />
            </IconButton>
            <Typography variant="h2" sx={style.header}>Real Estate AI Bot</Typography>

            <Typography variant="body1" sx={style.paragraph}>
                The Real Estate AI Bot is an advanced tool designed to handle real estate inquiries using OpenAI's GPT models. It's particularly adept at providing insightful and accurate information for the real estate market, using advanced NLP techniques to ensure contextually aware and relevant interactions.
            </Typography>

            <Box sx={style.featureBox}>
                <Typography variant="h4" sx={style.featureHeading}>Key Features:</Typography>
                <ul>
                    <li><Typography variant="body1">Leverages OpenAI's GPT models for detailed and accurate real estate responses.</Typography></li>
                    <li><Typography variant="body1">Capable of maintaining conversation context for more coherent interactions.</Typography></li>
                    <li><Typography variant="body1">Employs advanced NLP techniques for a deeper understanding of queries.</Typography></li>
                    <li><Typography variant="body1">Provides timely and personalized real estate advice.</Typography></li>
                </ul>
            </Box>

            <Box sx={style.featureBox}>
                <Typography variant="h4" sx={style.featureHeading}>Project Motivation:</Typography>
                <Typography variant="body1">
                    This bot was developed to explore the potential of AI in transforming the real estate industry, aiming to provide a more efficient and automated experience for both buyers and sellers.
                </Typography>
            </Box>

            <Box sx={style.featureBox}>
                <Typography variant="h4" sx={style.featureHeading}>Technical Stack:</Typography>
                <ul>
                    <li><Typography variant="body1">OpenAI GPT models for natural language processing.</Typography></li>
                    <li><Typography variant="body1">Python for backend development.</Typography></li>
                    <li><Typography variant="body1">Advanced algorithms for data analysis and response optimization.</Typography></li>
                    <li><Typography variant="body1">Cloud-based infrastructure for scalable and reliable performance.</Typography></li>
                </ul>
            </Box>
        </Box>
    );
};

export default RealEstateBot;
